import React from "react";
import { Carousel, Image, Jumbotron } from "react-bootstrap";
import IMG_2 from "../images/logB.png";
import IMG_3 from "../images/logD.png";
import IMG_1 from "../images/logS.png";
import "../index.css";
export default class Log extends React.Component {
  constructor() {
    super();
    this.state = {};
  }

  componentDidMount() {
    this.setState({});
  }

  render() {
    const imgStyle = {
      objectFit: "contain",
      maxWidth: "50vw",
      maxHeight: "50vw",
    };
    return (
      <div
        style={{
          textAlign: "center",
          margin: "auto",
          width: "100%",
          height: "80vw",
          backgroundColor: "SlateGray",
          padding: "2.5vw",
        }}
      >
        <Jumbotron
          style={{
            // backgroundImage: "url(" + BG_IMG + ")",
            width: "80vw",
            height: "auto",
            margin: "auto",
            color: "white",
            padding: "10px",
            // backgroundRepeat: "no-repeat",
            // backgroundSize: "cover",
          }}
        >
          <h1 style={{ fontSize: "15vw", backgroundColor: "DarkSlateGray" }}>
            Training Log
          </h1>
          <p style={{ fontSize: "8vw", backgroundColor: "DarkSlateGray" }}>
            This page is currently under development.
          </p>
          <p style={{ fontSize: "2vw", backgroundColor: "DarkSlateGray" }}>
            ...but I do have some pictures
          </p>
        </Jumbotron>
        <hr />
        <Carousel>
          <Carousel.Item>
            <Image src={IMG_1} style={imgStyle} />
          </Carousel.Item>
          <Carousel.Item>
            <Image src={IMG_2} style={imgStyle} />
          </Carousel.Item>
          <Carousel.Item>
            <Image src={IMG_3} style={imgStyle} />
          </Carousel.Item>
        </Carousel>
      </div>
    );
  }
}
